 ('19c82d4cc2414633b8c6e26ef56a5d0a','数据中心运营管理','<H4>IDC业务运营的重要保障<FONT class=font_333_12>&nbsp;<B></B></FONT></H4>\r\n<P></P>\r\n<LI class=cont_li>业务开通自动化，增强业务运营能力</LI>\r\n<LI class=cont_li>服务级别参数化，提高客户满意度</LI>\r\n<LI class=cont_li>服务保障程序化，提升客户资产价值</LI>',NULL,'1',0,'2012-03-02',NULL,'2','138133f8376b464d88ed520feda7dccf'),
 ('c7b91955105c4e929a5ebeab861dddba','金融行业运维管理','<H4>让IT管理投入产生投资回报<FONT class=font_333_12>&nbsp;<B></B></FONT></H4>\r\n<P></P>\r\n<LI class=cont_li>及时提供各种硬件设备及应用系统业务信息</LI>\r\n<LI class=cont_li>方便、直观、全面地了解系统运行状态</LI>\r\n<LI class=cont_li>及时发现和排除异常，降低故障率</LI>\r\n<LI class=cont_li>确保系统安全稳定运行</LI>\r\n<LI class=cont_li>护航金融业务系统，带来直观经济效益</LI>',NULL,'1',0,'2012-03-02',NULL,'2','138133f8376b464d88ed520feda7dccf'),
 ('506bb96e6753477482a1610c6ae387bc','政府及企业运维管理','<H3>\r\n<H4>实现IT运维主动化和精细化管理<FONT class=font_333_12>&nbsp;<B></B></FONT></H4>\r\n<P></P>\r\n<LI class=cont_li>IT基础架构平台及承载业务的可用性</LI>\r\n<LI class=cont_li>IT设备及业务性能、配置资源的统一监控管理</LI>\r\n<LI class=cont_li>相关基本流程标准化和规范化</LI>\r\n<LI class=cont_li>集中统计分析运维管理数据</LI></H3>',NULL,'1',0,'2012-03-02',NULL,'2','138133f8376b464d88ed520feda7dccf'),
 ('b32bf593a3a64d1f8cd39c7626d4f573','电子运维','<H4>电信业务服务质量的重要保障<FONT class=font_333_12>&nbsp;<B></B></FONT></H4>\r\n<P></P>\r\n<LI class=cont_li>更快的客户响应速度</LI>\r\n<LI class=cont_li>更规范的故障处理流程</LI>\r\n<LI class=cont_li>更全面快捷的运维知识获取</LI>\r\n<LI class=cont_li>更有效的运维质量评估</LI>',NULL,'1',0,'2012-03-02',NULL,'2','7d66ecf5e9724110b0084c4b17cd8566'),
 ('289604412a264c28a6b52463f28d3754','数据网管','<H4>数据业务、增值业务网管领先的解决方案<FONT class=font_333_12>&nbsp;<B></B></FONT></H4>\r\n<P></P>\r\n<LI class=cont_li>电信运营商数据业务网网管的全面解决方案</LI>\r\n<LI class=cont_li>对平台设备和数据业务系统的集中监控管理</LI>\r\n<LI class=cont_li>有效统计分析信息和维护作业计划</LI>\r\n<LI class=cont_li>提供支撑数据网络运营的参考数据</LI>',NULL,'1',0,'2012-03-02',NULL,'2','7d66ecf5e9724110b0084c4b17cd8566');
